【商品名】<br>
LEDウインカーランプキット（左右2個1セット）<br><br>
【商品説明】<br>
●側面に18chipとLEDバルブトップに5chipを搭載することにより、明るさと拡散性を実現！<br>
●アルミヒートシンク構造で放熱対策を向上！<br>
●従来のT20LEDバルブに比べて、大きさが小さく無加工で取付可能。<br>
●バルブ交換タイプで付け替え簡単！<br>
<br>

【適合車種】<br>
■メーカー：トヨタ<br>
■車種：ハイエース<br>
■型式：KDH・TRH200　マイナー前/後<br>
■年式：H19.8 ～<br><br>
【セット内容】<br>
T20 LEDバルブ 左右2個1セット<br>
<br>
※こちらの商品品は、1台分のセットではございません。<br><br>







